import React from "react";
import { animal } from "../../interfaces";
import Card from "../UI/Card";

interface props {
    animal: animal
}

const  Animal: React.FC<props> = ({animal}) => {

    return(
        <Card className='animal' primary="text-blue-700" secondary="bg-zinc-900">
            <h1>{animal.title}</h1>
            <h2>{animal.amount}</h2>
        </Card>
    )
}

export default Animal
